import React from 'react';
import { useSelector } from 'react-redux';

const Filter = React.memo(() => {
    const filterQuery = useSelector(state.user.filterQuery);
    return (
        <div>
            <input type="text" value={filterQuery || ''} />
        </div>
    );
});

export default Filter;
